void SysTick_Init(void)
{
    SysTick -> CTRL = 0;                            // disable SysTick during setup
    SysTick -> LOAD = 0x00FFFFFF;                   // maximum reload value
    SysTick -> VAL = 0;                             // any write to current value clears it
    SysTick -> CTRL = 0x00000005;                   // enable SysTick, CPU clk, no interrupts
}

void SysTick_delay(uint16_t delay)
{
    int i;

          for(i=0; i<15; i++)                                 //accounts for different clock frequency
          {
              SysTick -> LOAD = ((delay*3000) - 1);           // 1ms count down to zero
              SysTick -> VAL = 0;                             // any write to CVR clears it
                                                              // and COUNTFLAG in CSR

              while((SysTick -> CTRL & 0x00010000) == 0);     // Wait for flag to be SET (Timeout happened)
              MAP_WDT_A_clearTimer();
          }
}

void Port8_Init(void)
{
    P8SEL0 &= ~(BIT4 | BIT5 | BIT6| BIT7);
    P8SEL1 &= ~(BIT4 | BIT5 | BIT6| BIT7);           //configure P8.4 thru 8.7 as GPIO
    P8DIR |= (BIT4 | BIT5 | BIT6| BIT7);            //make P8.4 thru 8.7 outputs
}

